import React from "react";
import "./Fundos.css"; // Arquivo de estilos

const Fundos = () => {
  return (
    <div className="fundos-container">
      <h1>Fundos de Investimento</h1>

      <div className="fundos-grid">
        {/* FII - LIFE11 */}
        <div className="fundo-card">
          <h2>FII - LIFE11</h2>
          <p>Fundo imobiliário focado em investimentos estratégicos.</p>
        </div>

        {/* FII - LRED11 */}
        <div className="fundo-card">
          <h2>FII - LRED11</h2>
          <p>Fundo especializado em loteamentos residenciais.</p>
        </div>

        {/* FII - LSOI11 */}
        <div className="fundo-card">
          <h2>FII - LSOI11</h2>
          <p>Fundo voltado para operações estruturadas.</p>
        </div>

        {/* FII - TERA11 */}
        <div className="fundo-card">
          <h2>FII - TERA11</h2>
          <p>Fundo diversificado em múltiplos segmentos imobiliários.</p>
        </div>
      </div>
    </div>
  );
};

export default Fundos;
